    const url = 'http://localhost:3000/api/products'
    const response = await axios.get(url)
    console.log(response.data);
  }

  return <>home</>;
}

Home.getInitialProps = async () => {
  // fetch data on the server
  const url = 'http://localhost:3000/api/products';
  const response = await axios.get(url);
  return { products: response.data };
